import React, { useEffect, useState } from "react";

const Cart = () => {
  const [data, setData] = useState([]);
  const fetchData = async () => {
    try {
      const res = fetch("https://fakestoreapi.com/carts");
      const neData = await res.json();
      setData(neData);
    } catch (e) {
      console.log(e);
    }
  };
  useEffect(() => {
    fetchData();
  }, []);
  useEffect(() => {
    console.log(data);
  }, [data]);
  return (
    <div>
      <h1>Cart List</h1>
      <ul>
        {data.map((item, index) => {
          <li key={index}>{item}</li>;
        })}
      </ul>
    </div>
  );
};

export default Cart;
